import React from "react";
import { Link } from "react-router-dom/cjs/react-router-dom.min";
import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

export const Login = () => {

    const history = useHistory();
    const link_register = () => {
        history.pushState("/register")
    }

    return (
        <div className="login">
            <form>
                <p></p>
                <label htmlFor="email">Email</label><p></p>
                <input type="email" placeholder="Email" /><p></p>
                <label htmlFor="Password">Password</label><p></p>
                <input type="password" placeholder="**********"/><p></p>
                <button type="submit">Login</button>
                <button onClick={ link_register }>Don't have an account ?</button>
            </form>
        </div>
    );
}
